/** @format */

import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { listAllFarms } from '../actions/userActions';
import 'react-circular-progressbar/dist/styles.css';
import LoadingBox from '../components/LoadingBox';
import MessageBox from '../components/MessageBox';

function Profile(props) {
	const userSignin = useSelector((state) => state.userSignin);
	const { userInfo } = userSignin;

	const userAllFarms = useSelector((state) => state.userAllFarms);
	const { loading, farms, error } = userAllFarms;

	const dispatch = useDispatch();
	useEffect(() => {
		dispatch(listAllFarms());
		return () => {
			//
		};
	}, [dispatch]);

	return (
		<>
			<div className="container mt-5 mb-5 ">
				{loading ? (
					<LoadingBox></LoadingBox>
				) : error ? (
					<MessageBox variant="danger">{error}</MessageBox>
				) : (
					<div className="row container-border">
						<div className="col-md-2"></div>
						<div className="col-md-8">
							<div className="row">
								<div className="col-md-6 center">
									<img
										src="https://miro.medium.com/max/1187/1*0FqDC0_r1f5xFz3IywLYRA.jpeg"
										alt="profile-img"
										className="user-img"
									/>
								</div>
								<div className="col-md-6 mt-4">
									<div className="">
										<p className="">
											{userInfo.firstName} {userInfo.lastName}
										</p>
										<p className="">
											<b>Phone ID: </b>0{userInfo.phone}
										</p>
										<p className="">
											<b>Cluster:</b> FarmersCoop, Ibadan
										</p>
									</div>
								</div>
							</div>
							<div className="row packages-row">
								{/* <div className="col-md-6 border-right">
									<h5>FarmSured Packages</h5>
									<ul className="">
										{farms.map((farm) => (
											<li className="" key={farm._id}>
												<Link to={'/farm-package/' + farm._id} className="">
													<i className="fa fa-check icon"></i> {farm.poultry_type}
													<CircularProgressbar
														value={farm.accured_points}
														text={`${farm.accured_points}%`}
														className="circular-bar ml-2"
														styles={{
															text: {
																fontSize: '30px'
															}
														}}
													/>
													;
												</Link>
											</li>
										))}
									</ul>

									<Link to="/add_package" className="btn btn-primary btn-sm mt-3 mb-5">
										ADD NEW FARM
									</Link>
								</div> */}
								<div className="co">
									<h5 className="">FarmSured Rewards</h5>
									<span className="point-text">Total Points</span>
									<span className="point-color">104</span> <br />
									<div className="mt-3 insu-info">
										<h4 className="">
											<i className="fa fa-circle"></i> FarmHealth Basic
										</h4>
										<p className="ml-3 mt-2">
											<i className="fa fa-check"></i> Free Farm Insurance
										</p>
										<div className="ml-5">
											{farms.length > 0 ? (
												<div>
													{farms.map((farm) => (
														<p className="">- {farm.farm_name} Protected</p>
													))}
												</div>
											) : (
												'No Farm Created'
											)}
										</div>
										<p className="ml-3 mt-1">
											<i className="fa fa-check"></i> Free Health Insurance
										</p>
										<div className="ml-5">
											<p className="">- 4 persons access to basic medicial insurance</p>
										</div>
									</div>
									<button className="btn btn-primary btn-sm mt-5">CLAIM REWARD</button>
								</div>
							</div>
						</div>
						<div className="col-md-2"></div>
					</div>
				)}
			</div>
		</>
	);
}

export default Profile;
